import time


#采用字符串和切片的方法,同时减少回溯
def lengthOfLongestSubstring(s):
    str_len = len(s)
    tmp_char = ""
    length = 0
    max_l = 0
    i = 0
    while i < str_len:
        if s[i] in tmp_char:
            tmp = tmp_char.index(s[i])
            tmp_char = tmp_char[tmp + 1:]
            length = length - tmp - 1
        tmp_char = tmp_char + s[i]
        length += 1
        i += 1
        if length > max_l:
            max_l = length
    print(tmp_char)
    return max_l


